import UIKit

class Solution {
    func lengthOfLongestSubstring(_ s: String) -> Int {
      // Create dictionaly
      var charDic = [Character: Int]();
      
      // Cast string to char Array
      let chars = Array(s);
      
      // Create distance
      var distance = 0;
      
      // Create pointer
      var pointer = 0;
      
      // Create for loop
      for i in 0..<s.count {
        // If dic has charArray[i]
        if let index = charDic[chars[i]] {
          pointer = max(index, pointer);
        }
        
        // Refresh distance
        distance = max(distance, i - pointer + 1);
        // Refresh dictionary
        charDic[chars[i]] = i + 1;
      }
      
      return distance;

    }
}

